import React from "react";
import Dashboardlogo from "../../Assests/images/dashboardlogo.svg";
import Notificationlogo from "../../Assests/images/notificationlogo.svg";
import Profilepic from "../../Assests/images/profilepic.png";
import "./navbar.scss";

function Navbar() {
  return (
    <div className="navbar-container">
      <div>
        <img className="navbar-container_Dashboardlogo" src={Dashboardlogo} />
      </div>
      <div className="navbar-container_inputbar">
        <input
          className="navbar-container_inputsearchbar"
          type="text"
          placeHolder="Search or type"
        />
      </div>
      <div className="navbar-container__rightelements">
        <span>
          <img
            className="navbar-container__bellicon"
            id="bellicon"
            src={Notificationlogo}
          />
        </span>
        <span>
          <img
            className="navbar-container__profilepic"
            id="profile"
            src={Profilepic}
          />
        </span>
      </div>
    </div>
  );
}

export default Navbar;
